import Collaborator from '../Collaborator'
import './Team.css'

function Team(props) {
    const sectionCss = {backgroundColor: props.secondaryColor}
    const h3Css = {borderColor: props.primaryColor}

    return (
        <section className="team" style={sectionCss}>
            <h3 style={h3Css}>{props.name}</h3>
            {props.collaborators.map( collaborator => <Collaborator name={collaborator.name} charge={collaborator.charge}/> )}
        </section>
    )
}

export default Team
